import unittest
import configparser
import file_helper
import cv2
import numpy as np

class TestSaveConfig(unittest.TestCase):
    def setUp(self):
        self.config = configparser.ConfigParser()
        self.config.read('./config.ini')

    def test_saveConfig(self):
        newcameramtx = self.config['intrinsic']['newcameramtx']
        self.config['intrinsic']['newcameramtx'] = 'test'
        file_helper.saveConfig(self.config)
        self.assertEqual(self.config['intrinsic']['newcameramtx'], 'test')

        self.config['intrinsic']['newcameramtx'] = newcameramtx
        file_helper.saveConfig(self.config)
        self.assertEqual(self.config['intrinsic']['newcameramtx'], newcameramtx)

